The Alibi (Brad Armstrong, Wicked Pictures / WebDl / 2010) 

Cheating on your husband can be a good thing, especially when it provides you with a solid alibi for his murder... When Tanya (jessica drake) is questioned about her whereabouts the afternoon her beloved husband was murdered, she reluctantly admits to an affair. One that was being consummated at the precise time her husband was meeting his demise, and with a married man no less. Detectives find themselves chasing their tail as the list of suspects grows almost as fast as the body count. It soon appears as though Tanya is hiding more than the affair with her 'alibi' and it's up to investigators to find out what. Award winning actress jessica drake and award winning director Brad Armstrong team up once again to create and erotic thriller that will keep you guessing until the last pop!

jessica drake, Raylene, Veronica Rayne

Couples, Feature

